function ForceGraph({
    nodes,
    links
  }, {
    nodeId = d => d.id,
    nodeGroup=d => d.year,
    nodeGroups,
    nodeTitle,
    nodeFill = "currentColor",
    nodeStroke = "#fff",
    nodeStrokeWidth = 1.5,
    nodeStrokeOpacity = 1,
    nodeRadius = 40,
    nodeStrength=-150,
    linkSource = ({source}) => source,
    linkTarget = ({target}) => target,
    linkStroke = "#999",
    linkStrokeOpacity = 0.6,
    linkStrokeWidth = 1.5,
    linkStrokeLinecap = "round",
    linkStrength=0.1,
    colors = ['#bccea1',  '#98b26c','#82a054','#6c8646','#576b38','#41502a','#364323'],//'#a9c087',
    width = screen.width*0.7,
    height = 800,
    invalidation,
    R= (document.getElementById("forceChartDiv").offsetWidth > 1000)? 100: 50
  } = {}) {
    M.AutoInit();

    const N = d3.map(nodes, nodeId).map(intern);
    const LS = d3.map(links, linkSource).map(intern);
    const LT = d3.map(links, linkTarget).map(intern);
    if (nodeTitle === undefined) nodeTitle = (_, i) => N[i];
    const T = nodeTitle == null ? null : d3.map(nodes, nodeTitle);
    const G = nodeGroup == null ? null : d3.map(nodes, nodeGroup).map(intern);
    const W = typeof linkStrokeWidth !== "function" ? null : d3.map(links, linkStrokeWidth);
    const L = typeof linkStroke !== "function" ? null : d3.map(links, linkStroke);
  
    console.log(nodeGroups)
   
    nodes = d3.map(nodes, (_, i) => ({id: N[i]}));
    links = d3.map(links, (_, i) => ({source: LS[i], target: LT[i]}));
  
   
    if (G && nodeGroups === undefined) nodeGroups = d3.sort(G);
  
   
    const color = nodeGroup == null ? null : d3.scaleOrdinal(nodeGroups, colors);
  
    const forceNode = d3.forceManyBody();
    const forceLink = d3.forceLink(links).id(({index: i}) => N[i])//.distance(50);
    const forceBoundary = () => {
      for (var i = 0, n = nodes.length, node; i < n; ++i) {
        node = nodes[i];
        if (node.x > width) node.x=width;
        if (node.x < 0) node.x=0;
        if (node.y > height) node.y=height;
        if (node.y < 0) node.y=0;
      }
    }
    if (nodeStrength !== undefined) forceNode.strength(nodeStrength);
    if (linkStrength !== undefined) forceLink.strength(linkStrength);
  
    const simulation = d3.forceSimulation(nodes)
        .force("link", forceLink)
        .force("charge", forceNode)
        .force("boundary", forceBoundary)
        .force("center", d3.forceCenter(width/2, height/2))
        .force("collide", d3.forceCollide(R/2).iterations(4))
        .on("tick", ticked);
  
    const svg = d3.select("#forceChartDiv")
        .attr("width", width)
        .attr("height", height)
        .attr("viewBox", [-width / 2, -height / 2, width, height])
        .attr("style", `max-width: 100%; height: auto; height: intrinsic;margin:0px ${(screen.width*0.2)/2}px`);

    const node = svg
      .selectAll("div.node")
      .data(nodes)
      .join("div.node")
        .style("position", "absolute")
        .each(function (d) {
            d3.select(this)
            .attr("id", function(d) { return d.id; })
            .style("width", (d.id.length < 9? R/2: R)+"px")
            .style("height", (d.id.length < 9? R/2: R)+"px")
            .append('a')
            .attr("class","modal-trigger")
            .attr("href",d => `#modal_${d.id.split('.')[0]}`)
            .append("img")
              .attr("class","fill")
              .style("border-radius", "100%")
              .style("width", "100%")
              .style("height", "100%")
              .attr("src", `./pictures/${d.id}`)
              .attr("alt", d.id)
              .call(drag(simulation))
  })

  
    if (G) node.selectAll('img').style("background-color", ({index: i}) => color(G[i]))
    if (G) node.selectAll('img').style("border", ({index: i}) => `${color(G[i])} solid`);
    if (invalidation != null) invalidation.then(() => simulation.stop());
  
    function intern(value) {
      return value !== null && typeof value === "object" ? value.valueOf() : value;
    }
  
    function ticked() {

        node
        .style("top", function (d) {
          return (d.y)+"px";
        })
        .style("left", function (d) {
          return (d.x)+"px";
        });
    }
  
    function drag(simulation) {    
      function dragstarted(event) {
        if (!event.active) simulation.alphaTarget(0.1).restart();
        event.subject.fx = event.subject.x;
        event.subject.fy = event.subject.y;
      }
      
      function dragged(event) {
        event.subject.fx = event.x;
        event.subject.fy = event.y;
      }
      
      function dragended(event) {
        if (!event.active) simulation.alphaTarget(0);
        event.subject.fx = null;
        event.subject.fy = null;
      }
      
      return d3.drag()
        .on("start", dragstarted)
        .on("drag", dragged)
        .on("end", dragended);
    }
  
}


